(115, 3, 479, 'ahmadqushai20@gmail.com', 'MBA2200097', '1173012401052724', '1173042303070001', '163/U/04/2007', 'Ahmad Qushai', 'Qushai', 1, 'Lhokseumawe', 1174366800, 1, 1, 'Dumai No.5 Komplek PAG', 'Muzakkir Walid', 'Muara Satu', 'Lhokseumawe', 'Aceh', '082277817762', 'Olahraga', 1, 162, 71, 57, 3, 4, 0, 4, 1, 'Indonesia', 'Tidak Ada', 'Tidak Ada', 'MBA2200097.png', 2, 1644503578, 2, 1645624209, 1, 'Saya adalah seorang siswa tamatan MTS yapena. Saya merupakan salah satu anggota baitul huffadz atau yang biasa disebut rumah tahfiz disana. Selain menghafal al-quran, saya juga suka berolahraga di waktu yang senggang seperti sore hari. Pelajaran akademik juga tidak saya tinggalkan karena akan menjadi penunjang bagi saya di masa depan. Alasan saya ingin bersekolah di Modal Bangsa Arun adalah saya ingin berkarya lebih jauh di bidang akademik, olahraga, dan tahfiz. Sebagaimana kita ketahui, Modal Bangsa Arun merupakan sekolah SMA terbaik di Aceh khususnya kota Lhokseumawe. ', 1644500512, 1645624209, NULL, 1, 4),
(116, 3, 480, 'alfiemunaakbar@gmail.com', 'MBA2200098', '1108022202070044', '1108024408070001', '14743/T/295/2008', 'Nadya Raihana', 'Nadya', 2, 'Lhokseumawe', 1186203600, 1, 1, 'Jl. Bujang Slamat No.2', 'Dusun Bujang Salim Keude Krueng Geukueh', 'Dewantara', 'Aceh Utara', 'Aceh', '085277768922', 'Membaca, Menulis, Menari', 2, 145, 38, 40, 1, 2, 0, 2, 1, 'Bahasa Indonesia', 'Tidak Ada', 'Tidak', 'MBA2200098.png', 2, 1644661454, 2, 1645624208, 1, 'Nama saya Nadya Raihana. Saya seorang yang gigih dalam menyelesaikan tugas-tugas, rajin sekolah, suka menari, periang, senang bergaul, disiplin, dan berkelakuan baik. Saya juga bisa membaca Al Quran dan selalu mendapat peringkat 10 besar setiap semester.\r\n\r\nMotivasi saya bersekolah di Modal Bangsa Arun yaitu berkeinginan untuk sekolah boording, agar bisa menjadi lebih mandiri dan disiplin. Sekolah Modal Bangsa Arun memiliki mutu pembelajaran yang bagus dan kegiatan ekstrakurikulernya banyak.', 1644500545, 1645624208, NULL, 1, 8),
