(133, 3, 497, 'mhafizhrdhtllh@gmail.com', 'MBA2200114', '1173012401053452', '1173042508070002', '4320/T/87/2007', 'Muhammad Hafizh Raudahtullah', 'Hafizh', 1, 'Lhokseumawe', 1188018000, 1, 1, 'Dumai No. 95', 'Batuphat Barat', 'Muara Satu', 'Lhokseumawe', 'Naggroe Aceh Darussalam', '3495', 'Olahraga Dan Membaca', 2, 168, 52, 57, 3, 4, 0, 3, 1, 'Indonesia', 'Tidak Ada', 'Tidak Ada', 'MBA2200114.jpg', 2, 1645082070, 2, 1645624138, 1, 'Nama saya Muhammad Hafizh Raudahtullah, biasa dipanggil Hafizh. Saya menyukai sepak bola, badminton, dan olahraga lainnya. Pelajaran yang saya sukai yaitu bahasa inggris dan matematika. Sekarang saya sedang menempuh pendidikan di Dayah Moder Arun. Saya anak ke 3 dari 4 bersaudara. Kepribadian yang saya miliki yaitu disiplin, rajin, dan suka menjaga kebersihan. Saya berasal dari komplek Perta Arun Gas bertepat di jalan Dumai nomor 95. Sifat saya adalah gembira dan tegas. Saya mengetahui informasi SMAN Modal Bangsa Arun ini dari teman-teman tingkat saya yang sedang belajar di sana juga dan dari abang saya tamatan MBA tahun 2015. Alasan saya ingin bersekolah di sini adalah untuk menambah wawasan, mencari suasana baru dan agar mendapat teman-teman yang baru. Saya mempunyai minat untuk belajar matematika dan bahasa inggris lebih jauh lagi. Saya senang membaca buku yang bersifat mengajak dan mendidik seseorang untuk melakukan hal positif. Dan sekarang adalah kesempatan saya untuk mendapatkan pelajaran yang lebih tinggi dan lebih baik lagi.', 1644539788, 1645624138, NULL, 1, 8),
