(468, 4, 833, 'farahdiana0505@gmail.com', 'MBA2300037', '1111171809080026', '1111172210070002', '6665/D134/2009', 'Muhammad Al Kautsar', 'Kautsar', 2, 'Kuta Blang', 1192856400, 1, 1, 'Medan-Banda Aceh', 'Kota', 'Kuta Blang', 'Bireuen', 'Aceh', '081362274676', 'Berenang, Badminton, Tennis Meja, Karate Dan Membaca Sejarah.', 4, 168, 55, 45, 3, 0, 0, 4, 1, 'Aceh Dan Indonesia', '-', '-', 'MBA2300037.jpg', 2, 1675095179, 1, NULL, NULL, 'Nama saya Muhammad Al Kausar. Anak terakhir sekaligus harapan terakhir orang tua. Saya seorang anak laki-laki yang sering dijuluki perfeksionis, detail, rajin, sangat terampil dalam bidang kesenian seperti kaligrafi, senang sekali membaca informasi tentang pengetahuan umum dan juga sejarah. Pribadi saya yang tenang sering sekali dianggap pemalu oleh orang sekitar. Ambisi saya untuk membangun kepercayaan diri saya sangatlah tinggi. Oleh karena itu, saya sangat ingin bersekolah di sekolah favorit seperti Modal Bangsa Arun. Motivasi saya adalah saya dapat bertemu dengan teman-teman yang pintar yang dapat saya ajak diskusi dalam banyak hal. Fasilitas dan sumber daya pengajar yang sangat berkualitas juga akan dapat menggiring saya mempelajari banyak hal dan tidak akan tertinggal di era modern ini. Apalagi dengan berbagai kegiatan ekstrakulikuler yang ada di sekolah justru dapat mengasah terus skill saya dalam berbagai bidang. Yang terakhir adalah masuk sekolah favorit juga akan mempermudah saya mendapatkan peluang untuk masuk ke perguruan tinggi negeri yang saya cita-citakan. ', 1675054980, 1675095179, NULL, 833, 4),
