(483, 4, 848, 'mnabilfahrazi8@gmail.com', 'MBA2300052', '1111132909200001', '1111130611070001', '150/U/03/2008', 'M. NABIL FAHRAZI', 'NABIL', 1, 'Bireuen ', 1194325200, 1, 1, 'Petua Raja', 'Aman', 'Kota Juang', 'Bireuen ', 'Aceh', '082180765290', 'Menggambar, Membaca, Menulis', NULL, 162, 42, 55, 2, NULL, NULL, 3, 1, 'Bahasa Indonesia ', 'Tidak Ada', 'Tidak', 'MBA2300052.jpg', 2, 1675264335, 1, NULL, NULL, 'Perkenalkan, nama saya M. Nabil Fahrazi, saya dari SMP Negeri 1 Bireuen. Hobi saya menggambar, membaca dan menulis. saya pernah mengikuti ekskul bahasa inggris, dan mengikuti kegiatan perjusami yang diadakan sekolah. Saya kerap kali mempesertakan diri dalam perlombaan yang diadakan di sekolah maupun di tempat pengajian dan Alhamdulillah, saya pernah menjuarai lomba cerdas cermat di sekolah dan di tempat pengajian, serta lomba MTQ di sekolah, dan juga pernah menerbitkan sebuah buku fiksi berjudul \"Teka- Teki di Sekolah Baru\" yang dipasarkan kepada anak-anak Indonesia. Motivasi saya untuk bersekolah di SMAN Modal Bangsa Arun adalah karena sekolah ini memiliki mutu yang bagus serta melahirkan tamatan yang sukses di universitas dalam maupun luar daerah dan saya ingin meningkatkan kemampuan saya juga di SMAN Modal Bangsa Arun ini ', 1675061033, 1675264335, NULL, 848, 12),
