(903, 5, 1272, 'nisrinanada688@gmail.com', 'MBA2400092', '1108090902070002', '1108146512080001', '3462/T/70/2010', 'Syifa Hafizah', 'Syifa', 2, 'Aceh Utara', 1230181200, 1, 1, 'Teladan', 'Makmur', 'Tanah Jambo Aye', 'Aceh Utara', 'Aceh', '-', 'Membaca, Menulis, Memasak, Dan Memotret (fotografi) ', 2, 164, 45, 53, 2, 3, 0, 3, 1, 'Indonesia', '-', '-', NULL, 2, 1707140778, 1, NULL, NULL, 'Nama saya Syifa Hafizah, saya merupakan seorang siswi dari Madrasah Tsanawiyah Swasta Yapena yang akan menamatkan jenjang pendidikan menengah pertama pada tahun 2024 ini. Saya telah mendapatkan banyak pengalaman serta pembelajaran selama menempuh jenjang pendidikan sehingga membuat saya menjadi pribadi yang lebih baik. Saya memiliki rasa ingin tahu yang lebih sehingga membuat saya ingin terus belajar dan memahami hal-hal yang baru. Proses pendidikan yang sudah saya dapatkan membuat saya menjadi pribadi yang lebih mandiri, lebih pandai dalam memanajemen waktu dan kegiatan yang saya lakukan, mampu bertutur kata dengan baik (komunikatif), kompetitif, dan inovatif. Selama saya bersekolah di jenjang menengah pertama saya mahir menggunakan bahasa Arab dan Inggris dalam percakapan sehari-hari. Tentunya sebagai seorang muslimah, saya senang mempelajari ilmu agama dan terus menggali ilmu pada bidang tersebut seperti fiqh, cara berperilaku yang baik (akhlak) dan mempelajari kisah mengenai umat Islam terdahulu yang dapat menjadi pembelajaran dalam kehidupan kita. Saya juga senang menghabiskan waktu luang saya dengan menghafal Al-Quran. Motivasi saya bersekolah di Modal bangsa Arun yaitu untuk mendapatkan ilmu baru dan pengalaman berharga, memiliki wawasan dan pengetahuan yang bermanfaat bagi masa depan saya dalam dunia perkuliahan, serta memiliki kesempatan untuk mengeksplorasi minat dan bakat dengan bergabung di klub atau ekstrakulikuler yang terdapat pada sekolah ini. ', 1706803257, 1707140778, NULL, 1272, 8),
