(1026, 5, 1395, 'aribrajwa4@gmail.com', 'MBA2400210', '1117020306060023', '1117020504050002', '1117-LU-18052013-0032', 'Arib Rajwa', 'Arib', 1, 'Blang Rakal', 1238907600, 1, 1, 'Bireun - Takengon', 'Blang Rakal', 'Pintu Rime Gayo', 'Bener Meriah', 'Aceh', '085262811909', 'Membaca, Menulis Dan Olahraga', 2, 160, 70, 56, 1, 0, 0, 2, 1, 'Indonesia', '-', '-', 'MBA2400210.jpeg', 2, 1707468899, 1, NULL, NULL, 'Saya percaya bahwa SMAN MODAL BANGSA ARUN adalah jendela menuju masa depan yang cerah dan penuh potensi. Setiap langkah yang saya ambil dalam perjalanan ini adalah bagian dari pondasi yang akan membentuk karier dan kehidupan saya di masa depan. Saya percaya bahwa di SMA, saya akan memiliki kesempatan untuk menemukan minat, bakat, dan tujuan hidup saya yang sebenarnya. Itulah mengapa saya siap untuk mengejar setiap peluang yang hadir dan memanfaatkannya sebaik mungkin.\r\n\r\nSaya memahami bahwa keputusan ini bukan hanya tentang mendapatkan nilai tinggi di ujian, tetapi juga tentang pengembangan diri secara menyeluruh. Saya akan berkomitmen untuk belajar dengan sungguh-sungguh, tidak hanya dalam hal akademis, tetapi juga dalam mengembangkan keterampilan sosial, kepemimpinan, dan kolaborasi. \r\n\r\nSaya percaya bahwa SMAN MODAL BANGSA ARUN adalah tempat di mana saya dapat tumbuh menjadi pribadi yang lebih baik, yang siap menghadapi tantangan dan memanfaatkan peluang di dunia nyata.\r\nKetika saya melangkah maju untuk mencapai tujuan, saya membawa dengan saya tekad yang tak tergoyahkan untuk mencapai impian dan tujuan saya. Saya yakin bahwa dengan kerja keras, ketekunan, dan fokus yang kuat, saya akan mampu meraih segala yang saya inginkan. Setiap hari adalah kesempatan baru untuk menjadi versi terbaik dari diri saya sendiri, dan saya bersedia menerima tantangan dengan keberanian dan keyakinan. \r\n', 1707318711, 1707468899, NULL, 1395, 5),
(1027, 5, 1396, 'auliarizki2610@gmail.com', 'MBA2400211', '1108101109060037', '1108102610080003', '617/U/13/2008', 'Ananda Aulia Rizki', 'Rizki', 1, 'Lhokseumawe', 1224997200, 1, 1, 'Sawang', 'Batee Timoh', 'Muara Batu', 'Aceh Utara', 'Aceh', '085282687933', 'Membaca, Olah Raga', 4, 160, 60, 59, 1, 2, 0, 2, 1, 'Indonesia', 'Tidak Ada', 'Tidak Ada', NULL, 2, 1707378556, 1, NULL, NULL, 'Ingin membuat perubahan pada diri sendiri karena dengan melanjutkan pendidikan yang unggul bisa memberikan efek yang lebih baik pada diri sendiri.\r\n\r\nMotivasi bersekolah di Modal Bangsa Arun\r\n1. Reputasi sekolah yang berkualitas\r\n2. Peluang karier yang tinggi\r\n3. Lingkungan belajar yang baik, aman dan nyaman.\r\n4. Fasilitas dan kurikulum yang baik.', 1707363916, 1707378556, NULL, 1396, 3),
