(3, 1, 1, 'PENERIMAAN PESERTA DIDIK BARU 2021-2022', '', NULL, '<p><strong>PERSYARATAN UMUM</strong></p>\r\n\r\n<ol>\r\n	<li>Mampu membaca Alquran.</li>\r\n	<li>Memiliki kemampuan dasar berbahasa inggris.</li>\r\n	<li>Sehat jasmani dan rohani serta bebas dari narkoba.</li>\r\n	<li>Sanggup tinggal di asrama selama pendidikan dan bersedia mematuhi peraturan/tata tertib sekolah dan asrama.</li>\r\n	<li>Memiliki nilai raport SMP/MTs untuk mata pelajaran Agama, Bahasa Indonesia, Bahasa Inggris, Matematika dan IPA dari semester 3, 4 dan 5 dengan rata-rata minimal 75.</li>\r\n	<li>Mengisi formulir pendaftaran secara Online.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>WAKTU DAN TEMPAT PENDAFTARAN</strong></p>\r\n\r\n<ol>\r\n	<li>Pendaftaran mulai tanggal 08 &ndash; 22 Maret 2021 dengan mengisi formulir pendaftaran secara Online melalui web resmi : https://psb.smanmba.sch.id.</li>\r\n	<li>Tes Tahap I (Ujian tulis/Akademik) dilaksanakan pada hari Sabtu tanggal 27 Maret 2021 pukul 08.00 s/d selesai di SMA Negeri Modal Bangsa Arun. Peserta tes wajib memakai seragam sekolah asal dan membawa pensil 2B dan papan alas (untuk sistem LJK).</li>\r\n	<li>Pengumuman Tes Tahap I pada Hari Rabu tanggal 31 Maret 2021.</li>\r\n	<li>Tes Tahap II (Wawancara, Baca Alqur&rsquo;an, Bahasa Inggris, kepribadian dan kesehatan) dilaksanakan pada hari Minggu tanggal 04 April 2021.</li>\r\n	<li>Pengumuman Tes Tahap II pada hari Selasa tanggal 06 April 2021.</li>\r\n	<li>Pendaftaran Ulang tanggal 07 s/d 10 April 2021 pukul 08.30 s/d 16.00 WIB (Kecuali Hari Sabtu pukul 08:30 s/d 12:00 ).</li>\r\n	<li>Bila tidak mendaftar ulang sampai dengan batas waktu yang ditentukan, calon siswa tersebut dianggap gugur.</li>\r\n	<li>Informasi pendaftaran dan pengumuman dapat di akses melalui laman www.smanmba.sch.id.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>KELENGKAPAN ADMINISTRASI (DISERAHKAN SAAT DAFTAR ULANG KELULUSAN)</strong></p>\r\n\r\n<ol>\r\n	<li>Mengembalikan formulir pendaftaran dan kartu peserta ujian yang telah di cetak, untuk putra dimasukkan dalam Map Merah dan Putri Map Kuning.</li>\r\n	<li>Asli dan Fotocopi Raport SMP/MTs semester 3, 4 dan 5 sebanyak 1 eks</li>\r\n	<li>Asli dan Fotocopy sertifikat lomba, jika ada</li>\r\n	<li>Pasfoto warna ukuran 3 x 4 cm sebanyak 3 lembar (Latar merah)</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PENGHARGAAN UNTUK CALON SISWA BERPRESTASI</strong></p>\r\n\r\n<p>SMA Negeri Modal Bangsa Arun memberikan penghargaan kepada calon siswa berprestasi dengan kriteria sbb :</p>\r\n\r\n<p>Bebas tes tahap I (Ujian Tulis/Akademik) untuk :</p>\r\n\r\n<ol>\r\n	<li>Juara 1, 2 dan 3 OSN/KSM, SMP/MTs Tingkat Propinsi/Kab/Kota,</li>\r\n	<li>Juara 1, 2 dan 3 MTQ tingkat Kab/Kota/Propinsi,</li>\r\n	<li>Siswa rangking 1 Kelas IX Semester V,</li>\r\n	<li>Juara 1 Desain Poster FLS2N SMP Tingkat Propinsi/Kab/Kota,</li>\r\n	<li>Juara 1 Gitar Solo FLS2N SMP Tingkat Propinsi/Kab/Kota,</li>\r\n	<li>Juara 1 Nyanyi Solo FLS2N SMP Tingkat Propinsi/Kab/Kota,</li>\r\n	<li>Tahfiz 2 Juz,</li>\r\n	<li>Juara 1 Karya tulis ilmiah dari lembaga kementerian.</li>\r\n	<li>Discount Sumbangan Dana Komite Sekolah untuk :</li>\r\n	<li>Peserta OSN/KSM, SMP/MTs Tingkat Nasional sebesar 100%</li>\r\n	<li>Juara 1 OSN/KSM SMP/MTs Tingkat Kab/Kota sebesar 25%</li>\r\n</ol>\r\n', 'PENERIMAAN PESERTA DIDIK BARU (PPDB) 2021-2022', 'ppdb', '022021', 1, 2, 1378, NULL, 1614315600, 1614339495, 1734082384, 1, NULL, 0, NULL, NULL, 1391),
(4, 1, 1, 'Petunjuk Daftar', '', NULL, '<p><strong>Tahap 1</strong></p>\r\n\r\n<ol>\r\n	<li>Buat akun pada tautan berikut : <a href=\"https://psb.smanmba.sch.id/user/registration/register\">Register</a></li>\r\n	<li>Setelah akun dibuat, sistem secara otomatis mengirim link ke alamat email yang didaftarkan</li>\r\n	<li>Buka email pribadi anda, dan periksa pesan masuk dari PSB SMAN Modal Bangsa Arun.</li>\r\n	<li>Klik link aktivasi yang terdapat di dalam isi pesan.</li>\r\n	<li>Jika proses ini berhasil maka akun sudah aktif dan bisa mengisi data pendaftaran.</li>\r\n	<li>Jika tidak menemukan pesan aktivasi di dalam email, silakan hubungi web admin untuk dibantu.</li>\r\n</ol>\r\n\r\n<p><img alt=\"\" class=\"img-fluid img-responsive\" src=\"/admin/uploads/blog/ietNovCTsQ7CxEmo.png\" style=\"height:424px; width:600px\" /></p>\r\n\r\n<p><strong>Tahap 2</strong></p>\r\n\r\n<ol>\r\n	<li>Siapkan dokumen seperti kartu keluarga, akte kelahiran, dan raport sekolah.</li>\r\n	<li>Lakukan proses login pada tautan berikut : <a href=\"https://psb.smanmba.sch.id/user/security/login\">Login</a>.</li>\r\n	<li>Setelah masuk ke halaman pengisian data, di sebelah kiri terdapat menu foto. Silahkan unggah foto dengan seragam sekolah, ukuran 4x3.</li>\r\n	<li>Lengkapi semua isian data, mulai dari biodata, asal sekolah, data orang tua, dan data nilai.</li>\r\n	<li>Lakukan finalisasi setelah indikator sempurna (100%). Data yang sudah difinalisasi tidak bisa diedit.</li>\r\n	<li>Cetak dokumen formulir dan kartu ujian. Kartu ujian harap dibawa saat ujian tes tahap 1 dan 2.</li>\r\n	<li>Satukan dokumen dalam satu map, warna merah untuk putra, dan warna kuning untuk putri.</li>\r\n	<li>Kumpulkan kepada panitia sesuai jadwal yang telah ditentukan.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Web Admin : Nanta Es (081 804 292926)</strong></p>\r\n', 'Petunjuk daftar Penerimaan Siswa Baru SMAN Modal Bangsa Arun', 'ppdb', '022021', 2, 2, 3240, NULL, 1614315600, 1614353209, 1733979977, 1, NULL, 0, NULL, NULL, 3254),
(6, 1, 1, 'Pengumuman Ujian Tes Tulis Tahap I', '', NULL, '<p style=\"text-align:center\"><strong>Nomor : 139/C.1.5/007/III/2021</strong></p>\r\n\r\n<p style=\"text-align:center\"><strong>Panitia Penerimaan Peserta Didik baru</strong></p>\r\n\r\n<p style=\"text-align:center\"><strong>SMA Negeri Modal Bangsa Arun</strong></p>\r\n\r\n<p style=\"text-align:center\"><strong>Tahun Pelajaran 2021/2022</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:upper-alpha\">\r\n	<li>Bagi setiap peserta ujian dan keluarga yang mengantar wajib mengindahkan dan menerapkan protokol kesehatan sesuai ketentuan yang berlaku.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start=\"2\" style=\"list-style-type:upper-alpha\">\r\n	<li>Bagi peserta ujian diharapkan sudah hadir di sekolah pada :</li>\r\n</ol>\r\n\r\n<p style=\"margin-left:40px\">Hari : Sabtu, 27 Maret 2021</p>\r\n\r\n<p style=\"margin-left:40px\">Waktu : 08.00 &ndash; Selesai</p>\r\n\r\n<p style=\"margin-left:40px\">Tempat : SMAN Modal Bangsa Arun</p>\r\n\r\n<p style=\"margin-left:80px\">dengan kententuan :</p>\r\n\r\n<ol style=\"margin-left:80px\">\r\n	<li>Memakai baju seragam sekolah asal.</li>\r\n	<li>Membawa perlengkapan alat tulis seperti pensil 2B, penghapus, dan papan alas.</li>\r\n	<li>Membawa kartu ujian.</li>\r\n	<li><strong>Sudah berada di lokasi ujian pada pukul 07.30 WIB</strong>.</li>\r\n</ol>\r\n\r\n<p style=\"margin-left:90.0pt\">&nbsp;</p>\r\n\r\n<ol start=\"3\" style=\"list-style-type:upper-alpha\">\r\n	<li>Kepada orang tua/wali dari seluruh calon siswa baru diundang untuk menghadiri rapat dengan komite sekolah pada hari Sabtu, 27 Maret 2021 pukul 09.30 sampai selesai. Bertempat di auditorium SMAN Modal Bangsa Arun. <strong>Demi alasan kesehatan, setiap calon siswa baru hanya diwakili oleh satu orang tua/wa</strong>li.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start=\"4\" style=\"list-style-type:upper-alpha\">\r\n	<li>Demikian pengumuman ini dibuat dan jika ada yang kurang jelas silahkan menghubungi narahubung yang tertera di <a href=\"https://psb.smanmba.sch.id/site/index\">beranda</a>.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" class=\"MsoTableGrid\" style=\"border-collapse:collapse; border:undefined\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:10.0cm\">\r\n			<p>Mengetahui,</p>\r\n\r\n			<p>Kepala Sekolah</p>\r\n\r\n			<p><strong>Dr. Muhammad</strong></p>\r\n\r\n			<p><strong>NIP 19670818 199512 1 001</strong></p>\r\n			</td>\r\n			<td style=\"width:184.0pt\">\r\n			<p>Lhokseumawe 25 Maret 2021</p>\r\n\r\n			<p>Ketua Panitia</p>\r\n\r\n			<p><strong>Helmi Dedi Wartana, S. Pd</strong></p>\r\n\r\n			<p><strong>NIP 19810628 200504 1 001</strong></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 'Pengumuman Ujian Tes Tulis Tahap I PPDB Tahun Ajaran 2021/2022', 'ppdb', '032021', 1, 1, 970, NULL, 1616648400, 1616653652, 1733689137, 1, NULL, 0, NULL, NULL, 981),
(7, 1, 1, 'Pengumuman Bebas Tes Tulis Tahap I', '', NULL, '<p style=\"text-align:center\"><strong>Panitia Penerimaan Peserta Didik baru</strong></p>\r\n\r\n<p style=\"text-align:center\"><strong>Nomor : 140/C.1.5/007/III/2021</strong></p>\r\n\r\n<p style=\"text-align:center\"><strong>SMA Negeri Modal Bangsa Arun</strong></p>\r\n\r\n<p style=\"text-align:center\"><strong>Tahun Pelajaran 2021/2022</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:upper-alpha\">\r\n	<li>Berdasarkan hasil pemeriksaan berkas yang diunggah saat penerimaan siswa baru yang telah dilaksanakan pada tanggal 08-22 Maret 2021, maka peserta yang dinyatakan &ldquo;Bebas Tes&rdquo; pada SMA Negeri Modal Bangsa Arun adalah sebagai berikut :</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" class=\"Table\" style=\"border-collapse:collapse; border:undefined; width:9.0cm\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:99.25pt\">\r\n			<p>MBA2100005</p>\r\n			</td>\r\n			<td style=\"width:155.9pt\">\r\n			<p>Nayla Nabila Syahel</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:99.25pt\">\r\n			<p>MBA2100012</p>\r\n			</td>\r\n			<td style=\"width:155.9pt\">\r\n			<p>JAVIERA JAUZANI</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:99.25pt\">\r\n			<p>MBA2100018</p>\r\n			</td>\r\n			<td style=\"width:155.9pt\">\r\n			<p>Dwi Fahrozi</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:99.25pt\">\r\n			<p>MBA2100025</p>\r\n			</td>\r\n			<td style=\"width:155.9pt\">\r\n			<p>Ahmad Aqil Syalikin</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:99.25pt\">\r\n			<p>MBA2100042</p>\r\n			</td>\r\n			<td style=\"width:155.9pt\">\r\n			<p>M. ISYRAQI AL FATHAN</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:99.25pt\">\r\n			<p>MBA2100045</p>\r\n			</td>\r\n			<td style=\"width:155.9pt\">\r\n			<p>YUMNA FAIRUZA</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:99.25pt\">\r\n			<p>MBA2100053</p>\r\n			</td>\r\n			