	<td style=\"width:99.25pt\">\r\n			<p>MBA2100039</p>\r\n			</td>\r\n			<td style=\"width:155.9pt\">\r\n			<p>Nabila Alya Zahra</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start=\"2\" style=\"list-style-type:upper-alpha\">\r\n	<li>Bagi peserta yang mengunggah sertifikat dan dinyatakan tidak lulus bebas tes dapat melakukan sanggahan dengan menghubungi nomor 0852600455 a.n. Emi Hasnita, ST. Mohon lengkapi bukti foto kartu ujian dan sertifikat yang diunggah. Sanggahan diterima paling lambat 26 Maret 2021 pukul 13.00 wib.</li>\r\n</ol>\r\n\r\n<p style=\"margin-left:21.3pt\">&nbsp;</p>\r\n\r\n<ol start=\"3\" style=\"list-style-type:upper-alpha\">\r\n	<li>Peserta yang dinyatakan bebas tes pada poin A, diharapkan mengikuti tes tahap II/tes wawancara dengan membawa kartu ujian dan bukti sertifikat pada:</li>\r\n</ol>\r\n\r\n<p style=\"margin-left:36.0pt\">Hari &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Minggu, 04 April 2021</p>\r\n\r\n<p style=\"margin-left:36.0pt\">Waktu &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : 08.00-16.00</p>\r\n\r\n<p style=\"margin-left:36.0pt\">Tempat&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : SMAN Modal Bangsa Arun</p>\r\n\r\n<p style=\"margin-left:36.0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp; Jalan Bontang Kompleks Perumahan PT PAG Batuphat, Lhokseumawe</p>\r\n\r\n<ol start=\"4\" style=\"list-style-type:upper-alpha\">\r\n	<li>Kepada orang tua/wali dari seluruh calon siswa baru diundang untuk menghadiri rapat dengan komite sekolah pada hari Sabtu, 27 Maret 2021 pukul 09.30 sampai selesai. Bertempat di auditorium SMAN Modal Bangsa Arun. Demi alasan kesehatan, setiap calon siswa baru hanya diwakili oleh satu orang tua/wali.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start=\"5\" style=\"list-style-type:upper-alpha\">\r\n	<li>Demikian pengumuman ini dibuat dan jika ada yang kurang jelas silahkan menghubungi narahubung yang tertera di <a href=\"https://psb.smanmba.sch.id/site/index\">beranda</a>.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" class=\"MsoTableGrid\" style=\"border-collapse:collapse; border:undefined\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:10.0cm\">\r\n			<p>Mengetahui,</p>\r\n\r\n			<p>Kepala Sekolah</p>\r\n\r\n			<p><strong>Dr. Muhammad</strong></p>\r\n\r\n			<p><strong>NIP 19670818 199512 1 001</strong></p>\r\n			</td>\r\n			<td style=\"width:184.0pt\">\r\n			<p>Lhokseumawe 25 Maret 2021</p>\r\n\r\n			<p>Ketua Panitia</p>\r\n\r\n			<p><strong>Helmi Dedi Wartana, S. Pd</strong></p>\r\n\r\n			<p><strong>NIP 19810628 200504 1 001</strong></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 'Pengumuman Bebas Tes Tulis Tahap I PPDB Tahun Pelajaran 2021/2022', 'ppdb', '032021', 1, 1, 913, NULL, 1616648400, 1616653928, 1734131180, 1, NULL, 0, NULL, NULL, 922),
