(10, 1, 1, 'PENERIMAAN PESERTA DIDIK BARU T.A. 2022-2023', '', NULL, '<p style=\"text-align:justify\">SMAN Modal Bangsa Arun kembali membuka penerimaan siswa didik baru mulai tanggal 10-25 Februari 2022. Pendaftaran dilakukan secara online dengan cara <a href=\"https://psb.smanmba.sch.id/user/register\">mendaftarkan akun</a> dan melengkapi isian beserta berkas yang diperlukan.&nbsp;Setiap calon siswa diharap&nbsp;melengkapi data secara online selama masa waktu pendaftaran. Jika terdapat kendala, silahkan menghubungi salah satu dari narahubung yang tertera. Sebelum mulai pengisian data, pastikan dokumen seperti <strong>Kartu Keluarga</strong>, <strong>Akte Kelahiran</strong>, <strong>Raport Sekolah</strong>, dan <strong>Sertifikat </strong>(jika ada dan dalam format pdf berukuran di bawah 1 Mb)&nbsp;tersedia agar pengisian berjalan lancar dan mencapai indikator 100%.</p>\r\n\r\n<p style=\"text-align:justify\">Narahubung :</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Drs. Mahdani Usman (0853 7385 3222)</li>\r\n	<li style=\"text-align:justify\">Mustarsyidah, S. Pd (0823 6452 7386)</li>\r\n	<li style=\"text-align:justify\">Azhar, S. Pd (0812 6579 362)</li>\r\n	<li style=\"text-align:justify\">Emi Hasnita, ST (0852 6004 5522)</li>\r\n</ol>\r\n\r\n<blockquote>\r\n<p style=\"text-align:justify\">Baca juga : <a href=\"https://psb.smanmba.sch.id/blog/4?title=Petunjuk+Daftar\">Petunjuk Daftar&nbsp;Online</a></p>\r\n</blockquote>\r\n\r\n<p style=\"text-align:justify\"><strong>A. Persyaratan Umum</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Mampu membaca Alquran.</li>\r\n	<li style=\"text-align:justify\">Memiliki kemampuan dasar berbahasa inggris.</li>\r\n	<li style=\"text-align:justify\">Sehat jasmani dan rohani serta bebas dari narkoba.</li>\r\n	<li style=\"text-align:justify\">Sanggup tinggal di asrama selama pendidikan dan bersedia mematuhi peraturan/ tata tertib sekolah dan asrama.</li>\r\n	<li style=\"text-align:justify\">Memiliki nilai raport SMP/MTs untuk mata pelajaran Agama, Bahasa Indonesia,</li>\r\n	<li style=\"text-align:justify\">Bahasa Inggris, Matematika dan IPA dari semester 3, 4 dan 5 dengan rata-rata minimal 75.</li>\r\n	<li style=\"text-align:justify\">Mengisi formulir pendaftaran secara Online.</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><strong>B. Waktu Dan Tempat Pendaftaran</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Pendaftaran mulai tanggal 10 s.d 25 Februari 2022 dengan mengisi formulir pendaftaran secara Online melalui web resmi : https://psb.smanmba.sch.id.</li>\r\n	<li style=\"text-align:justify\">Tes Tahap I (Ujian tulis/Akademik) dilaksanakan pada hari Sabtu tanggal 5 Maret 2022 pukul 08.00 s.d selesai di SMA Negeri Modal Bangsa Arun. Tes dilaksanakan menggunakan Computer Based Test (CBT).</li>\r\n	<li style=\"text-align:justify\">Pengumuman Tes Tahap I pada Hari Rabu tanggal 9 Maret 2022.</li>\r\n	<li style=\"text-align:justify\">Tes Tahap II (Wawancara, Baca Alqur&rsquo;an, Bahasa Inggris, Kepribadian dan Kesehatan) dilaksanakan pada hari Sabtu s.d Minggu tanggal 12 s.d 13 Maret 2022.</li>\r\n	<li style=\"text-align:justify\">Pengumuman Tes Tahap II pada hari Rabu tanggal 16 Maret 2022.</li>\r\n	<li style=\"text-align:justify\">Pertemuan Orang Tua/Wali Calon Siswa dengan Komite Sekolah pada hari Sabtu 19 Maret 2022.</li>\r\n	<li style=\"text-align:justify\">Pendaftaran Ulang tanggal 19 s.d 24 Maret 2022 pukul 08.30 s/d 15.00 WIB .</li>\r\n	<li style=\"text-align:justify\">Bila tidak mendaftar ulang sampai dengan batas waktu yang ditentukan, calon siswa tersebut dianggap gugur.</li>\r\n	<li style=\"text-align:justify\">Informasi pendaftaran dan pengumuman dapat di akses melalui laman <a href=\"http://www.psb.smanmba.sch.id/\">www.psb.smanmba.sch.id</a>.</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><strong>C. Kelengkapan Administrasi (Diserahkan Saat Pendaftaran Ulang Setelah Dinyatakan Lulus)</strong></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Mengembalikan formulir pendaftaran dan kartu peserta ujian yang telah dicetak, untuk putra dimasukkan dalam Map Merah dan Putri Map Biru.</li>\r\n	<li style=\"text-align:justify\">Asli dan Fotocopi Raport SMP/MTs semester 3, 4 dan 5 sebanyak 1 eks.</li>\r\n	<li style=\"text-align:justify\">Asli dan Fotocopy sertifikat lomba (jika ada).</li>\r\n	<li style=\"text-align:justify\">Pasfoto warna ukuran 3 x 4 cm sebanyak 8 lembar (Latar merah).</li>\r\n</ol>\r\n\r\n<p style=\"text-align:justify\"><strong>D. Penghargaan Untuk Calon Peserta Didik Berprestasi</strong></p>\r\n\r\n<p style=\"text-align:justify\">SMA Negeri Modal Bangsa Arun memberikan penghargaan kepada calon peserta didik berprestasi dengan kriteria sebagai berikut:</p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\">Bebas Tes Tahap I (Ujian Tulis/Akademik) yang dibuktikan dengan sertfikat untuk:</li>\r\n</ol>\r\n\r\n<ul style=\"margin-left:40px\">\r\n	<li style=\"text-align:justify\">Juara 1, 2 dan 3 KSN/KSM, SMP/MTs Tingkat Propinsi/Kab/Kota</li>\r\n	<li style=\"text-align:justify\">Juara 1, 2 dan 3 MTQ tingkat Kab/Kota/Propinsi</li>\r\n	<li style=\"text-align:justify\">Peserta didik dengan nilai tertinggi di Kelas IX Semester V</li>\r\n	<li style=\"text-align:justify\">Juara 1 Desain Poster FLS2N SMP Tingkat Propinsi/Kab/Kota</li>\r\n	<li style=\"text-align:justify\">Juara 1 Gitar Solo FLS2N SMP Tingkat Propinsi/Kab/Kota</li>\r\n	<li style=\"text-align:justify\">Juara 1 Gitar Duet&nbsp;FLS2N SMP Tingkat Propinsi/Kab/Kota</li>\r\n	<li style=\"text-align:justify\">Juara 1 Nyanyi Solo FLS2N SMP Tingkat Propinsi/Kab/Kota</li>\r\n	<li style=\"text-align:justify\">Tahfiz 2 Juz</li>\r\n	<li style=\"text-align:justify\">Juara 1 Karya Tulis Ilmiah dari Lembaga Resmi Negara</li>\r\n</ul>\r\n\r\n<ol start=\"2\">\r\n	<li style=\"text-align:justify\">Diskon Sumbangan Dana Komite Sekolah untuk:</li>\r\n</ol>\r\n\r\n<ul style=\"margin-left:40px\">\r\n	<li style=\"text-align:justify\">Peserta KSN/KSM, SMP/MTs Tingkat Nasional sebesar 100%.</li>\r\n	<li style=\"text-align:justify\">Juara 1 KSN/KSM SMP/MTs Tingkat Kab/Kota sebesar 25%</li>\r\n</ul>\r\n\r\n<p style=\"text-align:justify\"><img alt=\"\" class=\"img-fluid img-responsive\" src=\"/admin/uploads/blog/H3WEoPyU1FsvAj1G.png\" style=\"height:506px; width:900px\" /></p>\r\n', 'PPDB SMAN Modal Bangsa Arun Tahun Ajaran 2022/2023', 'ppdb, smanmba, aceh, lhokseumawe, asrama', '022022', 2, 1, 1768, NULL, 1643864400, 1643904333, 1731786923, 1, NULL, 0, NULL, NULL, 1790),
(11, 1, 1, 'Pengumuman Tes Tahap 1 dan Informasi Bebas Tes  PPDB Tahun Ajaran 2022-2023', '', NULL, '<p>Diberitahukan kepada calon siswa yang telah menyelesaikan proses registrasi hingga finalisasi data :</p>\r\n\r\n<ol>\r\n	<li>Peserta bebas tes tahap 1 akan diumumkan pada hari Selasa, 01 Maret 2022 pukul 10.00 wib di laman <em>website</em>.</li>\r\n	<li>Masa sanggah peserta bebas tes tahap 1 dilayani paling lambat Rabu, 02 Maret 2022 pukul 12.00 wib.</li>\r\n	<li>Bagi peserta yang tidak terdaftar sebagai peserta bebas tes (atau sanggahnya ditolak), wajib mengikuti ujian tes tahap 1.</li>\r\n	<li>Jadwal tes tulis tahap 1 dilaksanakan pada hari Sabtu, 05 Maret 2022 dengan agenda sebagai berikut :</li>\r\n</ol>\r\n\r\n<ul style=\"margin-left:40px\">\r\n	<li>Sesi 1 : 08.30-10.30, mata pelajaran Matematika dan Bahasa Indonesia</li>\r\n	<li>Sesi 2 : 11.00-13.00, mata pelajaran Bahasa Inggris dan IPA</li>\r\n</ul>\r\n\r\n<ol start=\"5\">\r\n	<li>Peserta ujian diharap sudah berada di lokasi pukul&nbsp;07.30 untuk simulasi dan pengecekan perangkat.</li>\r\n	<li>Ruang ujian akan diinformasikan H-1 di laman website.</li>\r\n	<li>Peserta ujian wajib menggunakan seragam sekolah asal, bersepatu, membawa kartu ujian, dan mentaati protokol kesehatan.</li>\r\n	<li>Ujian akan dilangsungkan menggunakan sistem berbasis komputer.</li>\r\n	<li>Peserta ujian diharapkan membawa smartphone (android/iphone) atau laptop yang batrenya tahan minimal 3 jam, dikarenakan tes tahap 1 akan menggunakan perangkat tersebut. <strong>Sekolah tidak menyediakan cok sambung</strong>.</li>\r\n	<li>Bagi yang tidak memiliki smartphone ataupun laptop, harap menghubungi Ms. Ida di nomor 0823 6452 7386 selambat-lambatnya Jumat, tanggal 4 Maret 2022 pukul 10.00 wib.</li>\r\n</ol>\r\n\r\n<p>Jika ada hal yang kurang jelas, silahkan menghubungi narahubung yang tertera. Terima kasih.</p>\r\n\r\n<p>Panita.</p>\r\n\r\n<p><img alt=\"\" class=\"img-fluid img-responsive\" src=\"/admin/uploads/blog/xT3DzFxcU6ZKZE2z.jpg\" style=\"height:387px; width:900px\" /></p>\r\n', 'Pengumuman Bebas Tes dan Tes Tahap 1 PPDB Tahun Ajaran 2022-2023 SMAN Modal Bangsa Arun.', 'ppdb, lhokseumawe, aceh', '022022', 2, 1, 2257, NULL, 1645765200, 1645781598, 1731338585, 1, NULL, 0, NULL, NULL, 2280),
(12, 1, 1, 'Pengumuman Bebas Tes Tahap 1 PPDB Tahun Ajaran 2022-2023', '', NULL, '<p style=\"text-align:center\"><strong>Panitia Penerimaan Peserta Didik baru</strong></p>\r\n\r\n<p style=\"text-align:center\"><strong>Nomor : 422. 1/ 109/ 2022</strong></p>\r\n\r\n<p style=\"text-align:center\"><strong>SMA Negeri Modal Bangsa Arun</strong></p>\r\n\r\n<p style=\"text-align:center\"><strong>Tahun Pelajaran 2022/2023</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol style=\"list-style-type:upper-alpha\">\r\n	<li>Berdasarkan hasil pemeriksaan berkas yang diunggah saat penerimaan siswa baru yang telah dilaksanakan pada tanggal 10-25 Februari 2022, maka peserta yang dinyatakan &ldquo;Bebas Tes&rdquo; pada SMA Negeri Modal Bangsa Arun adalah sebagai berikut :</li>\r\n</ol>\r\n\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"width:695px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>MBA2200007</td>\r\n			<td>DITA KHOIRUN NISA</td>\r\n			<td>MBA2200363</td>\r\n			<td>Cut Alia</td>\r\n		</tr>\r\n		<tr>\r\n			<td>MBA2200011</td>\r\n			<td>NATAYA DHIASTRIYA</td>\r\n			<td>MBA2200003</td>\r\n			<td>Muhammad Ringgo Pratama</td>\r\n		</tr>\r\n		<tr>\r\n			<td>MBA2200048</td>\r\n			<td>TASYA DELVIANA</td>\r\n			<td>MBA2200004</td>\r\n			<td>TEUKU ARIEF AL GHIFARI</td>\r\n		</tr>\r\n		<tr>\r\n			<td>MBA2200058</td>\r\n			<td>SAUSAN AFRA DHIYA</td>\r\n			<td>MBA2200005</td>\r\n			<td>ADYA SUKRIA</td>\r\n		</tr>\r\n		<tr>\r\n			<td>MBA2200059</td>\r\n			<td>Bunga Rajwa</td>\r\n			<td>MBA2200020</td>\r\n			<td>MUHAMMAD AFZAL NEIJA</td>\r\n		</tr>\r\n		<tr>\r\n			<td>MBA2200069</td>\r\n			<td>Shira Rizkyani</td>\r\n			<td>MBA2200035</td>\r\n			<td>RAYYAN PUTRA</td>\r\n		</tr>\r\n		<tr>\r\n			<td>MBA2200071</td>\r\n			<td>DHAIFA AFWANA</td>\r\n			<td>MBA2200074</td>\r\n			<td>NYAK M. DAFFA AR-RAZI</td>\r\n		</tr>\r\n		<tr>\r\n			<td>MBA2200079</td>\r\n			<td>Nabila Syifa Muharani</td>\r\n			<td>MBA2200076</td>\r\n			<td>Ichlasul Imam Gayoevara</td>\r\n		</tr>\r\n		<tr>\r\n			<td>MBA2200