>\r\n			<td>MBA2200346</td>\r\n			<td>Ghaaniya Fayza</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>MBA2200351</td>\r\n			<td>Razitha Fachrunnisa</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start=\"2\" style=\"list-style-type:upper-alpha\">\r\n	<li>Peserta yang namanya <u><strong>tidak ada</strong></u> pada poin A&nbsp;wajib hadir dan mengikuti tes tahap 1 pada :</li>\r\n</ol>\r\n\r\n<p style=\"margin-left:36.0pt\">Hari : Sabtu, 05 Maret 2022</p>\r\n\r\n<p style=\"margin-left:36.0pt\">Waktu : 07.30 - selesai</p>\r\n\r\n<p style=\"margin-left:36.0pt\">Tempat : SMAN Modal Bangsa Arun</p>\r\n\r\n<p style=\"margin-left:36.0pt\">Jalan Bontang Kompleks Perumahan PT PAG Batuphat, Lhokseumawe</p>\r\n\r\n<p style=\"margin-left:36.0pt\">&nbsp;</p>\r\n\r\n<ol start=\"3\" style=\"list-style-type:upper-alpha\">\r\n	<li>Bagi peserta yang mengunggah sertifikat dan dinyatakan tidak lulus bebas tes dapat melakukan sanggahan dengan menghubungi nomor 0852-6004-5522 a.n. Emi Hasnita, ST. Mohon lengkapi bukti foto kartu ujian dan sertifikat yang diunggah. Sanggahan diterima paling lambat 02 Maret 2022 pukul 12.00 wib.</li>\r\n</ol>\r\n\r\n<p style=\"margin-left:21.3pt\">&nbsp;</p>\r\n\r\n<ol start=\"4\" style=\"list-style-type:upper-alpha\">\r\n	<li>Peserta yang <u><strong>dinyatakan bebas tes</strong></u> pada poin A, diharapkan mengikuti tes tahap II/tes wawancara dengan membawa kartu ujian dan bukti sertifikat pada:</li>\r\n</ol>\r\n\r\n<p style=\"margin-left:36.0pt\">Hari : Sabtu, 12 Maret 2022</p>\r\n\r\n<p style=\"margin-left:36.0pt\">Waktu : 07.30 - selesai</p>\r\n\r\n<p style=\"margin-left:36.0pt\">Tempat : SMAN Modal Bangsa Arun</p>\r\n\r\n<p style=\"margin-left:36.0pt\">Jalan Bontang Kompleks Perumahan PT PAG Batuphat, Lhokseumawe</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol start=\"5\" style=\"list-style-type:upper-alpha\">\r\n	<li>Demikian pengumuman ini dibuat dan jika ada yang kurang jelas silahkan menghubungi narahubung.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table cellspacing=\"0\" class=\"MsoTableGrid\" style=\"border-collapse:collapse; border:undefined\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:10.0cm\">\r\n			<p>Mengetahui,</p>\r\n\r\n			<p>Kepala Sekolah</p>\r\n\r\n			<p><strong>Nurasmah, S. Pd, M. Pd</strong></p>\r\n\r\n			<p><strong>NIP 19700401 199501 2 001</strong></p>\r\n			</td>\r\n			<td style=\"width:184.0pt\">\r\n			<p>Lhokseumawe 01 Maret 2022</p>\r\n\r\n			<p>Ketua Panitia</p>\r\n\r\n			<p><strong>Drs. Mahdani Usman, S. Pd</strong></p>\r\n\r\n			<p><strong>NIP. -</strong></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', 'Pengumuman Bebas Tes Tahap 1 PPDB Tahun Ajaran 2022-2023', 'ppdb, smanmba, lhokseumawe', '032022', 2, 1, 1423, NULL, 1646110800, 1646109098, 1733417811, 1, NULL, 0, NULL, NULL, 1432),
(13, 1, 1, 'Panduan Teknis Pelaksanaan Tes Tahap 1 PPDB 2022-2023', '', NULL, '<p>Petunjuk Teknis Pelaksanaan Tes Tahap 1 PPDB 2022/2023</p>\r\n\r\n<p>(<strong>Edited. </strong>Tentang syarat tes dan perangkat baca di :&nbsp;<a href=\"https://psb.smanmba.sch.id/blog/11?title=Pengumuman+Tes+Tahap+1+dan+Informasi+Bebas+Tes++PPDB+Tahun+Ajaran+2022-2023\">Pengumuman Bebas Tes Tahap 1</a>)</p>\r\n\r\n<ol>\r\n	<li>Pastikan batre perangkat dalam keadaan full.</li>\r\n	<li>Matikan paket data.</li>\r\n	<li>Hubungkan ke WIFI sesuai ruangan (akan diarahkan oleh pengawas ruang).</li>\r\n	<li>Buka/gunakan aplikasi browser Chrome atau Safari dengan versi terbaru.</li>\r\n	<li>Clear chache/hapus data penjelajah pada browser (peserta ujian) yang akan digunakan.</li>\r\n	<li>Alamat akan diarahkan oleh pengawas ruang dan hanya bisa diakses saat pelaksanaan ujian.</li>\r\n	<li>Jangan keluar/menutup/close browser saat pelaksanaan ujian karena bisa mengakibatkan kehilangan data.</li>\r\n	<li>Jika saat pelaksanaan ujian terjadi kendala, diharap segera melaporkan kepada pengawas.</li>\r\n</ol>\r\n\r\n<p>Selamat melaksanakan ujian.</p>\r\n\r\n<p>Panitia.</p>\r\n', 'Petunjuk Teknis Pelaksanaan Tes Tahap 1 PPDB 2022/2023', 'ppdb, smanmba, aceh, lhokseumawe, asrama', '032022', 2, 1, 741, NULL, 1646283600, 1646289075, 1731865771, 1, NULL, 0, NULL, NULL, 755);
