(15, 1, 1, 'Pengumuman Kelulusan Tes Tahap 1  PPDB Tahun Ajaran 2022-2023', '', NULL, '<p><img alt=\"\" class=\"img-fluid img-responsive\" src=\"/admin/uploads/blog/iASlrRsTIpHrHweJ.jpg\" /></p>\r\n', 'Pengumuman Tes Tahap 1  PPDB Tahun Ajaran 2022-2023 SMAN Modal Bangsa Arun', 'ppdb, lhokseumawe, aceh, smanmba, ujian', '032022', 2, 1, 1857, NULL, 1646802000, 1646812499, 1733977608, 1, NULL, 0, NULL, NULL, 1863),
(16, 1, 1, 'Penundaan Pengumuman Kelulusan Tahap 2', '', NULL, '<p>Berdasarkan beberapa pertimbangan, dengan ini disampaikan bahwa :</p>\r\n\r\n<ol>\r\n	<li>Pengumuman tahap 2 diundur menjadi tanggal 19 Maret 2022</li>\r\n	<li>Daftar ulang diundur menjadi tanggal 26-30 Maret 2022</li>\r\n</ol>\r\n\r\n<p>Mohon maaf atas ketidaknyamanan ini.</p>\r\n\r\n<p>Panitia</p>\r\n\r\n<p><img alt=\"\" src=\"https://smanmba.sch.id/main/admin/uploads/blog/leevkKHZCH-kezh9.jpg\" style=\"height:344px; width:800px\" /></p>\r\n', 'Penundaan Pengumuman Kelulusan Tahap 2 PPDB 2022-2023 SMAN Modal Bangsa Arun', 'smanmba, ppdb, aceh, lhokseumawe', '032022', 2, 1, 1297, NULL, 1647406800, 1647402034, 1734095014, 1, NULL, 0, NULL, NULL, 1299),
(17, 1, 1, 'Pengumuman Kelulusan PPDB 2022-2023', NULL, NULL, '<p><strong>Lihat di :&nbsp;<a href=\"https://smanmba.sch.id/main/blog/75?title=Pengumuman+Kelulusan+PPDB+2022-2023\">Pengumuman Kelulusan PPDB 2022-202</a></strong></p>\r\n\r\n<ul>\r\n</ul>\r\n', 'Pengumuman Kelulusan PPDB 2022-2023 SMAN Modal Bangsa Arun', 'ppdb, smanmba, lhokseumawe', '032022', 2, 1, 1089, NULL, 1647666000, 1647699901, 1733352713, 1, NULL, 0, NULL, NULL, 1090),
(18, 1, 1, 'Penerimaan Siswa Baru TA 2023-2024', '', NULL, '<p>Penerimaan Siswa Baru SMAN Modal Bangsa Arun Tahun Ajaran 2023-2024 :</p>\r\n\r\n<ul>\r\n	<li>\r\n	<p>Pendaftaran Mulai tanggal 30 Januari s.d 8 Februari 2023 dengan mengisi formulir pendaftaran secara online.</p>\r\n	</li>\r\n	<li>\r\n	<p>Tes Tahap I (Ujian tulis/Akademik) dilaksanakan pada hari Sabtu tanggal 11 Februari 2023 pukul 08.00 s.d selesai di SMA Negeri Modal Bangsa Arun. Tes dilaksanakan menggunakan Computer Based Test (CBT).</p>\r\n	</li>\r\n	<li>\r\n	<p>Pengumuman Tes Tahap 1 pada hari Rabu tanggal 15 Februari 2023 via web sekolah.</p>\r\n	</li>\r\n	<li>\r\n	<p>Tes Tahap 2 (Wawancara dan Kesehatan) dilaksanakan pada Sabtu s.d Minggu tanggal 18 dan 19 Februari 2023.</p>\r\n	</li>\r\n	<li>\r\n	<p>Pengumuman Tes Tahap 2 pada hari Rabu tanggal 22 Februari 2023 via web sekolah.</p>\r\n	</li>\r\n	<li>\r\n	<p>Pertemuan Orang Tua/Wali Calon Siswa dengan Komite Sekolah pada hari Sabtu, 25 Februari 2023 pada pukul 09:00 WIB.</p>\r\n	</li>\r\n	<li>\r\n	<p>Pendaftaran Ulang mulai tanggal 25 Februari s.d 1 Maret 2023 pukul 08:30 s.d 15:00 WIB.</p>\r\n	</li>\r\n	<li>\r\n	<p>Bila tidak mendaftar ulang sampai batas waktu yang ditentukan, calon siswa dianggap mengundurkan diri.</p>\r\n	</li>\r\n</ul>\r\n\r\n<hr />\r\n<blockquote>\r\n<p><strong>Narahubung :</strong></p>\r\n\r\n<p><strong>Mustarsyidah, S. Pd (0823 6452 7386)</strong></p>\r\n\r\n<p><strong>Maimun, S. Pd. I, M. Pd (0852 7759 9676)</strong></p>\r\n\r\n<p><strong>Emi Hasnita, ST (0852 6004 5522)</strong></p>\r\n</blockquote>\r\n', 'Penerimaan Siswa Baru SMAN Modal Bangsa Arun TA 2023-2024', 'ppdb, smanmba', '012023', 2, 1, 970, NULL, 1674277200, 1674299263, 1733334971, 1, NULL, 0, NULL, NULL, 973),
(19, 1, 1, 'Pengumuman  Pelaksanaan Tes Tahap 1 dan Bebas Tes PPDB Tahun Ajaran 2023-2024', '', NULL, '<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Assalamualaikum wr wb.<br />\r\n<br />\r\nDengan hormat</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Teriring salam dan doa semoga Bapak/Ibu dalam keadaan sehat waafiat dan selalu dalam lindungan Allah SWT.</span></span></p>\r\n\r\n<p style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Sehubungan kegiatan Penerimaan Peserta Didik Baru (PPDB) SMAN Modal Bangsa Arun Tahun Pelajaran 2023/2024, dengan ini kami sampaikan beberapa hal berikut:</span></span></p>\r\n\r\n<ol>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Tes Tahap 1</span></span> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">(Tes Akademik) akan dilaksanakan pada S</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">abtu</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\"> tanggal 11 Pebruari 2023</span></span><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\"> pada pukul 7.30 s.d selesai</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Membawa Kartu Peserta Ujian PPDB SMAN Modal Bangsa Arun TP. 2023/2024 dan alat tulis</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Tes Akademik terdiri dari 2 sesi</span></span></li>\r\n</ol>\r\n\r\n<ul style=\"margin-left:40px\">\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Sesi 1: 8.00 s.d 10.00 Mata Pelajaran Matematika dan Bahasa Indonesia</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Sesi 2: 10.30 s.d 12.30 Mata Pelajaran Bahasa Inggris dan Ilmu Pengetahuan Alam(IPA)</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Sesi 3: 14.00 s.d 16.00 Panggung Apresiasi Siswa</span></span></li>\r\n</ul>\r\n\r\n<ol start=\"4\">\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Pelaksanaan tes dilakukan dengan sistem Computer Based Test (CBT) menggunakan perangkat Laptop Computer atau Android Smartphone.</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Untuk kelancaran pelaksanaan tes tersebut, mohon Orang tua/Wali membekali anandanya dengan salah satu perangkat tersebut dalam kondisi baterai penuh <em>(fully charged</em>) , membawa power bank, charger dan wire/kabel sambung jika Perlu</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Menggunakan pakaian seragam sekolah asal dan memakai sepatu</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">Orang tua/wali yang mendampingi ananda harap berpakaian sopan</span></span></li>\r\n	<li style=\"text-align:justify\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif; font-size:12.0pt\">Peserta bebas tes tahap 1 ( bebas tes tulis ) adalah :</span></li>\r\n</ol>\r\n\r\n<table border=\"1\" cellspacing=\"0\" class=\"MsoTableGrid\" style=\"border-collapse:collapse; border:1pt solid windowtext; height:441px; width:457px\">\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"width:96.7pt\">\r\n			<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">NO PESERTA</span></span></p>\r\n			</td>\r\n			<td style=\"width:167.95pt\">\r\n			<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\">NAMA</span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:96.7pt\">\r\n			<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\"><span style=\"color:black\">MBA2300003</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:167.95pt\">\r\n			<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\"><span style=\"color:black\">Abdella Yoerisya</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:96.7pt\">\r\n			<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\"><span style=\"color:black\">MBA2300011</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:167.95pt\">\r\n			<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\"><span style=\"color:black\">Nasywa Khaidira</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:96.7pt\">\r\n			<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\"><span style=\"color:black\">MBA2300075</span></span></span></p>\r\n			</td>\r\n			<td style=\"width:167.95pt\">\r\n			<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\"><span style=\"color:black\">Nashara Alinka</span></span></span></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"width:96.7pt\">\r\n			<p><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Book Antiqua&quot;,serif\"><span style=\"color:black\