(12, 1, 'Deskripsi Report', '018', '<p><strong>Jadwal Kegiatan PPDB TP 2024/2025</strong></p>\n\n<ul>\n	<li>Pendaftaran Calon Siswa : Kamis, 01 Feb - Sabtu 10 Februari 2024</li>\n	<li>Tes Tahap 1 : Sabtu, 17 Februari 2024, pukul 08.00 - Selesai</li>\n	<li>Pengumuman Tes Tahap 1 : Rabu, 21 Februari 2024</li>\n	<li>Tes Tahap 2 : Sabtu, 24 Februari 2024</li>\n	<li>Pengumuman Tes Tahap 2 : Rabu, 28 Februari 2024</li>\n	<li>Pendaftaran Ulang : 02 Maret - 06 Maret 2024, Pukul 08.30-15.00 (Sabtu, Pukul 08.30-14.00)</li>\n</ul>\n\n<p><strong>Informasi Tes Tahap 1 (Akademik)</strong></p>\n\n<ul>\n	<li>Hari/Tanggal : Sabtu, 17 Februari 2024</li>\n	<li>Mapel : Matematika, Bahasa Indonesia, IPA, Bahasa Inggris</li>\n	<li>Sesi 1 : 08.00-10.00</li>\n	<li>Sesi 2 : 10.30-12.30</li>\n	<li>Lokasi : SMAN Modal Bangsa Arun</li>\n</ul>\n\n<p><strong>Perlengkapan Peserta Tes</strong></p>\n\n<ul>\n	<li>Kartu Peserta PPDB 2024/2025</li>\n	<li>Laptop atau smartphone</li>\n	<li>Pakaian Seragam Sekolah Asal dan Memakai Sepatu</li>\n	<li>Alat Tulis : Pensil, Karet Penghapus, Rautan, Pulpen</li>\n</ul>\n', NULL, 'DESKRIPSI', 2147483647, 1706766086, 1, 1, 0, NULL, NULL, 12),
