(22, 2, 'Promo Text 2', '203', '<p>Melaksanakan pendidikan umum yang bersinergi dengan agama.<br />\r\nMembentuk intelektual berintegritas dan mampu<br />\r\nmenghadapi tantangan hidup</p>\r\n', NULL, 'PROMO 2 - DESKRIPSI', 2147483647, 1613840262, 1, 1, 0, NULL, NULL, 3),
(23, 2, 'Visi', '204', '<p><span style=\"color:#072a2b\">Terselenggaranya pendidikan yang menghasilkan intelektual islami yang berprestasi dan berwawasan global.</span></p>\r\n\r\n<p>&nbsp;</p>\r\n', '_qUuAeX9UWswfngtVJgjAFJLHRFaSYOD.JPG', 'ABOUT 1 / Image 1200x800', 2147483647, 1674753542, 1, 1, 0, NULL, NULL, 21),
(24, 2, 'Kurikulum Merdeka', '205', '<p>Kurikulum dengan pembelajaran intrakurikuler yang beragam sehingga muatannya lebih optimal agar peserta didik dapat mendalami konsep dan menguatkan kompetensi diri, misalnya dengan Projek Penguatan Profil Pelajar Pancasila (P5).</p>\r\n', 'OcI9dLQTpr3aDhZ7oz60G6FzyN8cCPYP.jpg', 'ABOUT 2 / Image 1200x800', 2147483647, 1674752351, 1, 1, 0, NULL, NULL, 11),
(25, 2, 'Sekolah Penggerak', '206', '<p><span style=\"color:#032836\">SMAN Modal Bangsa Arun merupakan Satuan Pendidikan Pelaksana Program Sekolah Penggerak sesuai dengan Surat Keputusan Direktur Jenderal Pendidikan Anak Usia Dini, Pendidikan Menengah Nomor: 7883/C/HK.03.01/2022</span></p>\n', '6m654aS_WidiaLuG6GL_pvwdo36cRjtj.jpg', 'ABOUT 3 / Image 1200x800', 2147483647, 1674752486, 1, 1, 0, NULL, NULL, 17),
(26, 2, 'Narahubung', '207', '<p>Setiap calon siswa harus melengkapi data secara online. Jika terdapat kendala, silahkan menghubungi salah satu dari narahubung yang tertera.</p>\r\n\r\n<p>Sebelum mulai pengisian data, pastikan dokumen seperti Kartu Keluarga, Akte Kelahiran, dan Raport Sekolah tersedia agar pengisian berjalan lancar dan mencapai indikator 100%.</p>\r\n', NULL, 'TEAM - Header dan Deskripsi', 2147483647, 1613984893, 1, 1, 0, NULL, NULL, 4),
(27, 2, 'Muzakkir, S. Pd., M. Pd', '208', '<p>0813-6030-2206</p>\r\n', 'V7OEtXu4nWL8DgjcmQ59-u0y7asTlH4d.jpg', 'Ketua Panitia', 2147483647, 1705205548, 1, 1, 0, NULL, NULL, 18),
